import React, { Component } from 'react';

class Counter extends Component {

    constructor(props) {
        super(props);
        this.state = {
            count: 0
        }
    }

    render() {
        return (
            <div>
                <div>Count - {this.state.count}</div>
                <div onClick="{this.increment}"></div> 
            </div>
        );
    }
}

export default Counter;
